column1:
@H.W J 보여주려면직접접으로하던가요..ㅎㅎ 캐치못했다고 남 비꼬시는말투네요 ㅎㅎ
저는 맞는말을했다고보는데 그림하나가지고 보는시점이 다 다르듯.. 
저는수직적으로봤는데 님은 입체적으로 님만의 견해를말했는데 저한테캐치못했다고 하시면안되죠

@댓글다는사람 미안 난 찐따가 와서 화내니까 혼자 ㅂㄷㅂㄷ하는줄ㅋ 갑자기 와서 "병신새끼들 뇌절 존나하네"ㅇㅈㄹ하는데 무가 화난거라고 보냨ㅋㅋ
너한테 피해가는게 없는데ㅋㅋㅋㅋ
걍 지혼자 존나 "우욱 쓰발 찐따쉑들끼리 뇌절하네 우욱"하는 찐따짘ㅋㅋㅋㅋ 글고 닉넴 좀 바꿔랔ㅋㅋㅋ 댓글다는 사람이 아니라 찐따겠짘ㅋㅋㅋ 사람이랑 찐따의 구분이 안감?ㅋㅋㅋㅋㅋㅋㅋ
